import './Homepage.scss';

const Homepage = () => {
  return (
    <div className="userHomepage">
      <h1>Username</h1>

      <h3>
        <span>First Name</span>
        <span>Last Name</span>
      </h3>
    </div>
  )
}

export default Homepage
